import logo from '../logo.png';
import TypingEffect from "../components/TypingEffect"; 


function Home() {
  return (
    <div className='bg-slate-50 flex flex-col space-y-4 items-center content-start text-center w-full h-dvh pt-12'>

      <img src={logo} className='max-w-full' alt="logo" />

      <p >
      <Typewriter
            className='font-mono font-semibold text-2xl'
            words={["Visualise", " your", " internet", " footprint", "."]}
            loop={0} // Infinite loop
            cursor
            cursorStyle="|"
            typeSpeed={100}
            deleteSpeed={0}
            delaySpeed={1000}
          />
      </p>

      <div className='bg-slate-500 w-11/12 max-w-md h-0.5 ' />


      <p className='font-mono font-semibold text-base'>
        Coming soon...
      </p>

    </div>
  );
}
export default Home;
